import axios from "axios";
import React from 'react';
import { useEffect, useState } from "react";
function  CreateUser() {
    const [id, setId] = useState("");
    const [username, setUsername] = useState("");
    const [email, setEmail] = useState("");
    const [phoneNo, setPhoneNo] = useState("");
    const [skillsets, setSkillsets] = useState("");
    const [hobby, setHobby] = useState("");
    const [freelancers, setUsers] = useState([]);

    useEffect(() => {
        (async () => await Load())();
    }, []);

    async function Load() {

        const result = await axios.get("https://localhost:7284/api/Freelancers/GetFreelancer");
        setUsers(result.data);
        console.log(result.data);
    }

    async function save(event) {

        event.preventDefault();
        try {
            await axios.post("https://localhost:7284/api/Freelancers/AddFreelancer", {

                username: username,
                email: email,
                phoneNo: phoneNo,
                skillsets: skillsets,
                hobby: hobby,

            });
            alert("Freelancer Registation Successfully");
            setId("");
            setUsername("");
            setEmail("");
            setPhoneNo("");
            setSkillsets("");
            setHobby("");


            Load();
        } catch (err) {
            alert(err);
        }
    }
    async function editFreelancer(freelancers) {
        setUsername(freelancers.username);
        setEmail(freelancers.email);
        setPhoneNo(freelancers.phoneNo);
        setSkillsets(freelancers.skillsets);
        setHobby(freelancers.hobby);


        setId(freelancers.id);
    }

    async function DeleteFreelancer(id) {
        await axios.delete("https://localhost:7284/api/Freelancers/DeleteFreelancer/" + id);
        alert("Freelancer deleted Successfully");
        setId("");
        setUsername("");
        setEmail("");
        setPhoneNo("");
        setSkillsets("");
        setHobby("");
        Load();
    }

    async function update(event) {
        event.preventDefault();
        try {
            await axios.patch("https://localhost:7284/api/Freelancers/UpdateFreelancer/" + freelancers.find((u) => u.id === id).id || id,
                {
                    id: id,
                    username: username,
                    email: email,
                    phoneNo: phoneNo,
                    skillsets: skillsets,
                    hobby: hobby,
                }
            );
            alert("Registation Updated");
            setId("");
            setUsername("");
            setEmail("");
            setPhoneNo("");
            setSkillsets("");
            setHobby("");

            Load();
        } catch (err) {
            alert(err);
        }
    }
    return (
        <div>
            <h1>Freelancer Details</h1>
            <div className="container mt-4">
                <form>
                    <div className="form-group">

                        <input
                            type="text"
                            className="form-control"
                            id="id"
                            hidden
                            value={id}
                            onChange={(event) => {
                                setId(event.target.value);
                            }}
                        />
                        <label>Freelancer username</label>
                        <input
                            type="text"
                            className="form-control"
                            id="username"
                            value={username}
                            onChange={(event) => {
                                setUsername(event.target.value);
                            }}
                        />
                    </div>
                    <div className="form-group">
                        <label>Email</label>
                        <input
                            type="text"
                            className="form-control"
                            id="email"
                            value={email}
                            onChange={(event) => {
                                setEmail(event.target.value);
                            }}
                        />
                    </div>
                    <div className="form-group">
                        <label>Phone Number</label>
                        <input
                            type="text"
                            className="form-control"
                            id="phoneNo"
                            value={phoneNo}
                            onChange={(event) => {
                                setPhoneNo(event.target.value);
                            }}
                        />
                    </div>
                    <div className="form-group">
                        <label>Skill sets</label>
                        <input
                            type="text"
                            className="form-control"
                            id="skillsets"
                            value={skillsets}
                            onChange={(event) => {
                                setSkillsets(event.target.value);
                            }}
                        />
                    </div>
                    <div className="form-group">
                        <label>Hobby</label>
                        <input
                            type="text"
                            className="form-control"
                            id="hobby"
                            value={hobby}
                            onChange={(event) => {
                                setHobby(event.target.value);
                            }}
                        />
                    </div>
                    <div>
                        <button className="btn btn-primary mt-4" onClick={save}>
                            Register
                        </button>
                        <button className="btn btn-warning mt-4" onClick={update}>
                            Update
                        </button>
                    </div>
                </form>
            </div>

        </div>
    );
}

export default  CreateUser;
